def isValid(s):
	l = {}

	for i in range(len(s)):
		if not s[i] in l:
			l[s[i]] = 1
		else:
			tmp = l[s[i]]
			tmp += 1
			l[s[i]] = tmp

	low = min(l, key=l.get)
	smallest = l[low]

	total = 0
	occurancesOfZero = 0
	occurancesOfOne = 0
	occurancesOfSameValue = 0
	recurringValue = -10000

	for i in range(len(l)):
		
		if (abs(smallest - l.values()[i])) == 1 :
			occurancesOfOne += 1
		elif (abs(smallest - l.values()[i])) == 0 :
			occurancesOfZero += 1
		elif (recurringValue == (abs(smallest - l.values()[i]))):
			occurancesOfSameValue += 1
		else:
			recurringValue = (abs(smallest - l.values()[i]))

	occurancesOfSameValue += 1

	if ((occurancesOfOne == 1 and occurancesOfZero == len(l) - 1) or (occurancesOfZero == 1 and occurancesOfOne == len(l) - 1) or
		(occurancesOfZero == 1 and occurancesOfSameValue == len(l) - 1)) or (occurancesOfZero == len(l)):
		print("YES")
	else:
		print("NO")
	


		

isValid("""""")
